const fs = require('fs');
var dataFile = fs.createWriteStream("scraped6.txt", 'utf8');
var jsonFile = fs.createWriteStream("data6.JSON", 'utf8');

var getRandomProxy = require('./proxySwitcher');

const Nightmare = require('nightmare');

Nightmare.action('proxy',
  function(name, options, parent, win, renderer, done) {
      parent.respondTo('proxy', function(host, done) {
          win.webContents.session.setProxy({
              proxyRules: 'http=' + host + ';https='+ host +';ftp=' + host,

          }, function() {
              done();
          });
      });

      done();
  },
  function(host, done) {
      this.child.call('proxy', host, done);
  });

  Nightmare.action(
    'clearCache',
    (name, options, parent, win, renderer, done) => {
      parent.respondTo('clearCache', done => {
        win.webContents.session.clearCache(done)
      })
      done()
    },
    function(done) {
      this.child.call('clearCache', done)
    }
  )





function scrape (url, pr, callback){
  var nightmare = Nightmare({
    // switches: {
    //   'proxy-server': '192.210.165.135:8800', // set the proxy server here ...
    //   'ignore-certificate-errors': true
    // },
    show: true,
    webPreferences: {images: true}
    });

  nightmare
  // .viewport(1024, 800)
  // .cookies.clearAll()

    .proxy(pr)
    // .clearCache()
    .goto(url)
    .exists('#lst-ib')
    // .then(()=> console.log('browsed!'))
    // .catch(()=> callback('err'))
    .evaluate(() => document.querySelector('#rso > div > div > div:nth-child(1) > div > div').outerHTML)
    .end()
    .then(function(htmlbody){
        getInfoCheerio(url, htmlbody, function(x){
          console.log(x);
          var out = '>' + x.link + '\t>' + x.name + '\t>' + x.url + '\t>' + x.desc  + '\n';
          dataFile.write(out,'utf8');
          jsonFile.write(JSON.stringify(x)+',\n', 'utf8');
          setTimeout(()=>{
            callback('ok');
          },100);
        });
        // console.log(htmlbody)
    })

    .catch(function (error) {
      // console.error('Error:', error);
      // getInfoCheerio(url, htmlbody, function(x){
      //   console.log(x);
        var out = '>' + url + '\t>No Result\t>No Result\t>No Result\n';
        dataFile.write(out,'utf8');
        // setTimeout(()=>{
          callback('ok');
        // },3000);
      // });
      // console.log(htmlbody)

    });
};


function getInfoCheerio(url, html, cb){
  const cheerio = require('cheerio');
  console.log('parsingCheerio')
  const $ = cheerio.load(html);
  let x = {};
  x.link = url;
  x.name = $('h3').text();
  x.url = $('h3 > a').attr('href');
  x.desc = $('span.st').text();
  cb(x);
  // console.log(x);
}

